        expected_time: "60",
        actual_time: "60"
    },
    {
        tip: "学习",
        now: "2022-03-07T02:08:44.025787",
        comment: "这学习多是一件美逝",
        expected_time: "60",
        actual_time: "60"
    },
    {
        tip: "学习",
        now: "2022-03-07T02:08:44.025787",
        comment: "这学习多是一件美逝",
        expected_time: "60",
        actual_time: "60"
    },
    {
        tip: "学习",
        now: "2022-03-07T02:08:44.025787",
        comment: "这学习多是一件美逝",
        expected_time: "60",
        actual_time: "60"
    },
]

function Card() {
    const [isVisible, setVisible] = useState(false);
    const [label, setLabel] = useState("");
    const [comment, setComment] = useState("");
    const [minute, setMinute] = useState(30);

    useEffect(() => {
        myStore.getTomatosRequest()
    }, [])

    const handleCreate = () => {
        setVisible(true);
    }

    const handleOk = () => {
        setVisible(false);
        setLabel("");
        setComment("");
        setMinute(30);
    }

    const handleCancel = () => {
        setVisible(false);
        setLabel("");
        setComment("");
        setMinute(30);
    }

    return (
        <div className="ca-ma">
            <div className="card">
                <div className="ca-header">番茄列表</div>
                <PlusCircleOutlined
                    className="ca-plus"
                    onClick={handleCreate}
                />
                <Modal
                    title="番茄学习法"
                    visible={isVisible}
                    onOk={handleOk}
                    onCancel={handleCancel}
                    okText="确认"
                    cancelText="取消"
                >
                    <div className="ca-modal">
                        <div className="ca-td">
                            <div className="ca-label">标签：</div>
                            <Input
                                className="ca-input"
                                placeholder="输入标签"
                                value={label}
                                onChange={({target: { value }}) => setLabel(value)}
                            />
                        </div>
                        <div className="ca-td">
                            <div className="ca-label">激励：</div>
                            <Input
                                className="ca-input"
                                placeholder="来句鼓励自己"
                                value={comment}
                                onChange={({target: { value }}) => setComment(value)}
                            />
                        </div>
                        <div className="ca-td">
                            <div className="ca-label">时间（分钟）：</div>
                            <InputNumber
                                min={1}
                                max={1440}
                                value={minute}
                                onChange={value => setMinute(value)}
                            />
                        </div>
                    </div>
                </Modal>
                <div className="ca-list">
                    {
                        myStore.tomatoList.length !== 0
                            ? <Empty
                                className="empty"
                                description="没有数据"
                                image={Empty.PRESENTED_IMAGE_SIMPLE}
                            />
                            : myStore.tomatoList.map((item, index) => {
                                const {
                                    tip, now, comment,
                                    expected_time, actual_time
                                } = item;

                                return <div className="ca-item" key={index}>
                                    <div className="ca-top">
                                        <div className="ca-tip">{tip}</div>
                                        <div className="ca-start-time">{now}</div>
                                    </div>
                                    <div className="ca-comment">{comment}</div>
                                    <div className="ca-bto">
                                        <div className="ca-left-time">预计：{expected_time} 分钟</div>
                                        <div className="ca-right-time">实际：{actual_time} 分钟</div>
                                    </div>
                                </div>
                            })
                    }
                </div>
            </div>
        </div>
    )
}

export default Card;
